import React from "react";
import car1 from "../../../public/Images/car1.jpeg";
import car2 from "../../../public/Images/car2.jpeg";
import car3 from "../../../public/Images/car3.jpeg";


export const Frontpage = () => {
  const options = {
    rewind: true,
    autoplay: true,
    margin: 30,
    responsiveClass: true,
    nav: true,
    navText: ["<", ">"],
    smartSpeed: 1000,
    responsive: {
      0: {
        items: 1,
      },
      400: {
        items: 1,
      },
      600: {
        items: 2,
      },
      700: {
        items: 3,
      },
      1000: {
        items: 5,
      },
    },
  };

  return (
    <OwlCarousel
      className="slider-items owl-carousel"
      {...options}
    >
      <div class="item">
        <h4>{car1}</h4>
      </div>
      <div class="item">
        <h4>{car2}</h4>
      </div>
      <div class="item">
        <h4>{car3}</h4>
      </div>
    </OwlCarousel>
  );
};
